import React, { useEffect, useRef, useState } from 'react'
import STYLE from "./app.module.css"
import AxiosInstance from './Axios'
const App = () => {
  let [EmployeeId,setEmployeeId]=useState("")
  let [DateOfJoining,setDateOfJoining]=useState("")
  let [DOB,setDOB]=useState("")
  let [Email,setEmail]=useState("")
  let [BloodGroup,setBloodGroup]=useState("")
  let [Designation,setDesignation]=useState("")
  let [Gender,setGender]=useState("")
  let [Nationality,setNationality]=useState("")
  let [EmployeeStatus,setEmployeeStatus]=useState("")
  let [EmployeeName,setEmployeeName]=useState("")

 let genRef=useRef()
 
  let handelSubmit=async(e)=>{
   e.preventDefault()
   let gender=genRef.current.value
   setGender(gender)
  //  console.log({EmployeeId,DateOfJoining,DOB,Email,BloodGroup,Designation,Gender,Nationality,EmployeeStatus,EmployeeName});
   let payload={
    EmployeeId,DateOfJoining,DOB,Email,BloodGroup,Designation,Gender
   }
  }
  return (
    <div >
      <form action="" onSubmit={handelSubmit} >
      <fieldset className={STYLE.div0}>
      <legend>Primary Info</legend>
      <div id={STYLE.div}>
        <label htmlFor="EmployeeId">EmployeeId</label>
        <input type="text" name='EmployeeId'onChange={(e)=>setEmployeeId(e.target.value)} />
        <label htmlFor="DateOfJoining">DateOfJoining</label>
        <input type="dateFormate" name='DateOfJoining' onChange={(e)=>setDateOfJoining(e.target.value)}/>
        <label htmlFor="DOB">DOB</label>
        <input type="date" name="DOB" onChange={(e)=>setDOB(e.target.value)}/>
        <label htmlFor="Email">Email</label>
        <input type="email" name="Email" onChange={(e)=>setEmail(e.target.value)} />
        <label htmlFor="BloodGroup">BloodGroup</label>
        <input type="text" name="BloodGroup" onChange={(e)=>setBloodGroup(e.target.value)}/>
        <button type='submit' style={{width:"100px",height:"30px",color:"white",backgroundColor:"blue" ,borderRadius:"10px"}}>Next</button>
        </div>
        <div id={STYLE.div1} >
          <label htmlFor="EmployeeName">EmployeeName</label>
          <input type="text" name="EmployeeName" onChange={(e)=>setEmployeeName(e.target.value)} />
        <label htmlFor="Designation">Designation</label>
        <input type="text"name='Designation' onChange={(e)=>setDesignation(e.target.value)} />
        <label htmlFor="Gender">Gender</label>
          <select name="Gender"  style={{height:"30px"}}>
            <option value="male" ref={genRef}>male</option>
            <option value="female">female</option>
            <option value="others">others</option>
          </select>
        <label htmlFor="Nationality">Nationality</label>
        
        <input type="text" name='Nationality' onChange={(e)=>setNationality(e.target.value)} />
        <label htmlFor="EmployeeStatus">EmployeeStatus</label>
        <input type="text" name="EmployeeStatus"onChange={(e)=>setEmployeeStatus(e.target.value)} />
      <button type='submit' style={{width:"100px",height:"30px",backgroundColor:"blue" ,color:"white",borderRadius:"10px"}}>Preview</button>
        </div>
      </fieldset>
    </form>
    </div>
  )
}

export default App
